import matplotlib.pyplot as plt
from collections import Counter


def counts_to_percents(counter, factor = 2):
    count_sum = sum(counter.values())
    # round((y/count_sum)*100)
    new_counter = Counter()
    for x, y in counter.items():
        newx = (round(x*factor, 1)/factor)
        new_counter.update({newx: y})
    return Counter({x: round((y/count_sum)*100) for x, y in new_counter.items()})


